//

#define AMC0_FIRST_REG 0x0000 // AMC_CONFIG_0
#define AMC0_LAST_REG 0x0044 // AMC_STATUS_0
#define AMC_EVP0_FIRST_REG 0x0700 // AMC_EVP_RESET_VEC_0
#define AMC_EVP0_LAST_REG 0x073c // AMC_EVP_FIQ_ADDR_0
